import React from "react";

function ShoppingCart() {
  return (
    <div className="ShoppingCart Right_part_page">
      <div className="ShoppingCart_body">
      <div className="ShoppingCart_title"> סל הקניות שלי </div>
      <p>המחירים ניתנים לשינוי בהתאם למחיר המעשי ביום ההזמנה.</p>
      <table>
      <thead><tr><th class="col-xs-6">פריט</th> <th class="col-xs-2">מחיר</th> <th class="col-xs-2">כמות</th> <th class="col-xs-2 good-total">סך הכול</th></tr></thead>
      
      </table>
      </div>
    </div>
  );
}
export default ShoppingCart;
